const offset = 25;
const width = g.getWidth();
const height = g.getHeight();
const font = "Vector:12";

const locale = require("locale");

var img = {
  width : 192, height : 160, bpp : 8,
  buffer : E.toArrayBuffer(atob(""))
};

function time() { //numbers
  const d = new Date();
  const h = d.getHours(),
    m = d.getMinutes();
  const time = h + ":" + ("0" + m).substr(-2);
  const day = Date.now();
  const mo = d.getMonth()+1;
  const damo = d.getDate();
  
  var dayMonth = mo+"-"+damo;   

  // time
  require("Font4x5").add(Graphics);
  g.setColor(0, 0, 0);
  g.setFontAlign(0,0);
  g.setFont("4x5",7);
  g.drawString(time, width/2, height/2);
  
  // date  
  require("Font4x5").add(Graphics);
  g.setFontAlign(1,1);
  g.setFont("4x5",3);
  g.drawString(dayMonth, width/2+60, height/2+40);
  
}

function draw() { 
  //poketch background
  g.drawImage(img, 0, 15); //poketch is life
  //show the numbers
  time();
}

//program start
g.clear(); //reset graphics
draw();
